import React from "react";
import Navigation from "./Navigation";

export const LargeQuote = props => {
  return (
    <section id="LargeQuote">
      <div className="">
        <h1>
          "Happiness is baking cookies. Happiness is giving them away. And
          serving them, and eating them, talking about them, reading and writing
          about them, thinking about them, and sharing them with you."
        </h1>
      </div>
    </section>
  );
};

export default LargeQuote;
